import React,{Component} from 'react'
import {Link} from 'react-router-dom';
import { connect } from 'react-redux'


 function users () {
    return function (dispatch) {
          return fetch('/details')
              .then(response => response.json())
              .then(json => dispatch(
              { type: "DATA_LOADED", data: json }))
        }
    }

 class Menu extends Component {
    render() {
        return (
            <div >
              <div>
              <center><label>Menu</label></center>
              <ul>
              <li> <Link to ="/">Userinfo</Link> </li>
              <li><Link to ="/Hi">Friends</Link></li>
              </ul>
            </div>
            </div>

        )
        }
    }
    const mapStatetoProps=(state)=> {
        return {userinfo: state.userinfo.slice(0,1) };
      }
      
    const mapDispatchtoProps = (dispatch) => {
        return {
           users: () => dispatch(users()) 
        }
      }
  
 export default connect(mapStatetoProps,mapDispatchtoProps,users) (Menu)
